try:
    conn = self._connections[ident]
except KeyError:
    raise FailedCommandError('camera is closed')
else:
    missing = msg.keys - set(conn.channels)
    if missing:
        raise FailedCommandError(f"nonexistent keys: {', '.join(missing)}")
    if msg.keys:
        return vision_msg.ChannelReply({key: conn.channels[key].msg for key in
            msg.keys})
    else:
        return vision_msg.ChannelReply({key: channel.msg for key, channel in
            conn.channels.items()})
_commands.register(vision_msg.ChannelRequest)
